import styled from 'styled-components';

const MiniTagContainer = styled.div`
  margin: 0 5px 10px 0;

`;

interface Tags {
  tagName: string;
}

const MiniTag = ({ tagName }: Tags) => (
  <MiniTagContainer>
    #
    {tagName}
  </MiniTagContainer>
);

export default MiniTag;
